// src/components/Dashboard.js
import React from 'react';
import './Dashboard.css';

const Dashboard = () => {
    return (
        <div className="dashboard-container">
            <h1>Dashboard</h1>
            <p>This is your secure dashboard.</p>
        </div>
    );
};

export default Dashboard;
